    true,nt"url": null,nt"notes": "U.S. Geological Survey, Department of the
    Interior - The annual Watershed Boundary Dataset (WBD) stewardship plan is to maintain
    watershed boundary data through usage of WBD edit tools over the United States and
    its territories. WBD for the nation has been collected and is now in maintenance
    mode. Interested parties who wish to become a stewardship partner with the USGS
    in FY17 or in future years should contact a USGS Geospatial Liaison - http://liaisons.usgs.gov/geospatial/documents/TNM_Partnership_User_ContactList.pdf.
    To find out more about watershed boundary stewardship go to http://nhd.usgs.gov/wbd.html
